import Header from "./components/header";
import Products from "./components/products";
import BasketList from "./components/basketlist";
import styles from "./styles/styles";

function App() {
  return (
    <>
      <div style={styles.container}>
        <Header />
        <Products />
        <BasketList />


      </div>
    </>
  );
}

export default App;
